      "uf":"SP",
      "renda_mensal":3000
  }
}

const getMoviesFromApi = (req) => {
  return fetch('http://192.168.137.1:3000/api')

    .then((response) => response.json())
    .then((json) => {
      return json.movies;
    })
    .catch((error) => {
      console.error(error);
    });
};

